-module(foo).
-export([main/1]).

-spec find_min_arrow_shots(Points :: [[integer()]]) -> integer().

main([]) ->
    Points = prepare_points(),
    R = find_min_arrow_shots(Points),
    io:format("~p~n",[R]).

find_min_arrow_shots(Points) ->
    List = arrow_mitosis(Points),
    Arrows = length(List).

arrow_mitosis(Points) ->
    Rbound = lists:usort([X || [_,X] <- Points]),
    ShootMap = loop_shot(Rbound,Points),
    Arrows = lists:usort([A || {A,_} <- ShootMap]).

loop_shot(Rbound,Points) ->
    loop_shot(Rbound,Points,[]).

loop_shot([H|T],Points,Acc) ->
    Bomed = [{H,X} || X <- Points,bomornot(H,X)],
    Remains = [X || X <- Points,not bomornot(H,X)],
    Rbound = lists:usort([X || [_,X] <- Remains]),
    loop_shot(Rbound,Remains,Acc++Bomed);

loop_shot([],Points,Acc) ->
    Acc.

bomornot(H,P) ->
    [S,E] = P,
    ((H - S >= 0) and (E - H >= 0)). 

